

SET NAMES 'utf8';

USE bonds;
DROP TABLE IF EXISTS bonds._temp_amortization;

CREATE TABLE bonds._temp_amortization (
  ISIN VARCHAR(50) DEFAULT NULL,
  `Полное наименование ЦБ` VARCHAR(50) DEFAULT NULL,
  `Объем эмиссии (млн)` VARCHAR(50) DEFAULT NULL,
  Дата VARCHAR(50) DEFAULT NULL,
  Номинал VARCHAR(50) DEFAULT NULL,
  `Валюта номинала` VARCHAR(50) DEFAULT NULL,
  `Непогашенный номинал` VARCHAR(50) DEFAULT NULL,
  `Выплата (% от номинала)` VARCHAR(50) DEFAULT NULL,
  `Размер выплаты` VARCHAR(50) DEFAULT NULL,
  `Размер выплаты, руб.*` VARCHAR(50) DEFAULT NULL
)
ENGINE = INNODB;


